import { Model } from 'acey'

const DEFAULT_DATA ={
    content: '',
    id: 0,
    counter: 0
}

class Todo extends Model {

    constructor(data = DEFAULT_DATA, options: any){
        super(data, options)
        this.setState({
            counter: new Counter({counter: data.counter}, this.__childOptions)
        })
    }

    counter = () => this.state.counter
    content = () => this.state.content
    ID = () => this.state.id
}

export default Todo
